import Layout from '../components/Layout';



// function Home() {
//   return <div>SRE To-do List</div>;
// }

// refactor above function with arrow function
//replace <div> with <Layout>
const Register = () => {
  const registerForm = () => (
    <form>
      <div className="form-group">
        <input type="text" className="form-control" placeholder="Type your name" />
      </div>
      <div className="form-group">
        <input type="email" className="form-control" placeholder="Type your email" />
      </div>
      <div className="form-group">
        <input type="password" className="form-control" placeholder="Type your password" />
      </div>
      <div className="form-group">
        <input type="text" className="form-control" placeholder="Type your name" />
      </div>

    </form>
  )

  return <Layout>
    <div className="col-md-6 offset-md-3">
      <h1>Register</h1>
      <br />
      {registerForm()}
    </div>
  </Layout>;
}


export default Register;
